//提取十六进制
function parseHex(data) {
  var hexRet = {};
  hexRet.data = "";
  hexRet.code = true;

  for (var i = 0; i < data.length; i++) {
    try {
      var c = data.substring(i, i + 1);
      if (c == " " || c == "\n" || c == "0") {
        //空格、回车不用屏蔽
        hexRet.data += c;
        continue;
      }
      var n = parseInt("0x" + c);
      if (!n) {
        // isHex = false;
        hexRet.code = false;
        break;
      } else
      {
        hexRet.data += c;
      }
    } catch (e) {
      // isHex = false;
      hexRet.code = false;
      break;
    }
  }
  return hexRet;
}

//剔除空格回车
function stringTrim(data) {
  var resultStr = data.replace(/[ ]/g, ""); //去掉空格
  return resultStr.replace(/[\r\n]/g, ""); //去掉回车换行
}

//将非中文字符串转16进制字符串，每个前面加0x,回车加0a0d
function strToHexCharCode(str) {
  if (str === "")
  return "";
  var hexCharCode = [];
  // 　　hexCharCode.push("0x");
  for (var i = 0; i < str.length; i++) {
    var c = str.substring(i, i + 1);
    if (c == "\n") {
      //换行
      hexCharCode.push("0a".toString(16));
      continue;
    } else
    if (c == "\r") {
      //回车
      hexCharCode.push("0d".toString(16));
      continue;
    }

    hexCharCode.push(str.charCodeAt(i).toString(16));
  }
  return hexCharCode.join("");
}

//asii码字符串转十六进制字符串  用于图片打印
function asiiStrToHex(str) {
  var hex = "";
  for (var i = 0; i < str.length; i++) {
    var c1 = str.charAt(i);
    var c2 = str.substring(i, i + 1);
    var c3 = str.substring(i, i + 2);
    var c4 = str.substr(i, i + 1);
    var c5 = str.substr(i, i + 2);
    var c = str.charCodeAt(i).toString(16);
    var c6 = str.charCodeAt(i);
    if (c.length == 1) {
      c = "0" + c;
    }
    hex += c;
  }
  return hex;
}
function toUTF8Array(str) {
  var utf8 = [];
  for (var i = 0; i < str.length; i++) {
    var charcode = str.charCodeAt(i);
    if (charcode < 0x80) utf8.push(charcode);else
    if (charcode < 0x800) {
      utf8.push(0xc0 | charcode >> 6,
      0x80 | charcode & 0x3f);
    } else
    if (charcode < 0xd800 || charcode >= 0xe000) {
      utf8.push(0xe0 | charcode >> 12,
      0x80 | charcode >> 6 & 0x3f,
      0x80 | charcode & 0x3f);
    }
    // surrogate pair
    else {
        i++;
        // UTF-16 encodes 0x10000-0x10FFFF by
        // subtracting 0x10000 and splitting the
        // 20 bits of 0x0-0xFFFFF into two halves
        charcode = 0x10000 + ((charcode & 0x3ff) << 10 |
        str.charCodeAt(i) & 0x3ff);
        utf8.push(0xf0 | charcode >> 18,
        0x80 | charcode >> 12 & 0x3f,
        0x80 | charcode >> 6 & 0x3f,
        0x80 | charcode & 0x3f);
      }
  }
  return utf8;
}

